function displayThumbnails(e){let t=document.getElementById("thumbnail-container"),n="";n+='<div class="thumbnail-page">';for(let t=0;t<e.length;t++)n+=`\n      <a href="https://youtu.be/${e[t]}" target="_blank">\n        <img class="thumbnail"\n            src="https://i.ytimg.com/vi/${e[t]}/mqdefault.jpg" \n            alt="thumbnail"></a>`,t%100==99?n+='</div><div class="thumbnail-page">':t%10==9&&(n+="<br>");t.innerHTML=n}function loadUploads(){document.getElementById("thumbnail-container").innerHTML='\n    <div class="text-center"><i class="fas fa-cog fa-3x fa-spin"></i></div>\n  ',requestSpreadsheetData("Input Data","Video List").then(e=>{let t=[],n=getColumnHeaders(e);for(let a=e.length-1;a>=1;a--){const i=e[a],l=i[n["Video ID"]];t.push(l)}displayThumbnails(t),document.getElementById("error-container").className="d-none"}).catch(e=>{document.getElementById("thumbnail-container").innerHTML="",document.getElementById("error-container").className="d-block",document.getElementById("error-message").innerText=e.message})}function loadSignedIn(){document.getElementById("menu").innerHTML+='<button class="btn btn-lg btn-primary mt-3" id="refresh-btn">Refresh Thumbnails</button>',document.getElementById("thumbnail-container").innerHTML='<h5>No thumbnails are loaded. Press the "Refresh Thumbnails" button to view the thumbnails.</h5>',document.getElementById("about-list").innerHTML+='\n      <li>Thumbnails not loading? Try <a href="" id="signout-text">signing out</a> and signing back in.</li>\n      <li>\n        Missing some thumbnails? Make sure the missing videos are listed in the \n        <a href="https://docs.google.com/spreadsheets/d/1LNVjw5Hf2Ykp89jtxaX9itH5NOoudwaz0T74E7flZZg/edit#gid=485839191?usp=sharing"\n          target="_blank">"ADC Video Dashboard Input Data" Google Sheet</a>.\n      </li>\n    ';let e=document.getElementById("signout-text");e.addEventListener("click",handleSignout);let t=document.getElementById("refresh-btn");t.addEventListener("click",loadUploads),loadUploads()}